window.bookSummaryJSON = "<p><b><i>\"</i></b><b>Narrator Raphael Corkhill deftly navigates a range of situations and voices in this novel, a blend of romance, mystery, and space opera.... A satisfying love story with plenty of political machinations, this audiobook will please fans of romance and sci-fi alike.\" (</b><b><i>AudioFile</i></b><b>)</b></p> <p><b><i>Ancillary Justice </i></b><b>meets </b><b><i>Red, White &amp; Royal Blue </i></b><b>in </b><b><i>Winter’s Orbit, </i></b><b>Everina Maxwell’s gut-wrenching and romantic debut.</b></p> <p>A famously disappointing minor royal and the emperor's least favorite grandchild, Prince Kiem is summoned before the emperor and commanded to renew the empire's bonds with its newest vassal planet. The prince must marry Count Jainan, the recent widower of another royal prince of the empire.</p> <p>But Jainan suspects his late husband’s death was no accident. And Prince Kiem discovers Jainan is a suspect himself. But broken bonds between the empire and its vassal planets leaves the entire empire vulnerable, so together they must prove that their union is strong while uncovering a possible conspiracy.</p> <p>Their successful marriage will align conflicting worlds.</p> <p>Their failure will be the end of the empire. </p> <p><b>A Macmillan Audio production from Tor Books</b></p>"; 
